                                }
                        });
                }


                function displayAssocData() {
                        var assocData = "true";
                        $.ajax({
                                url: 'adminViews/includes/map-Assoc.php',
                                type: 'post',
                                data: {
                                        mapAssocSend: assocData
                                },
                                success: function(data, status) {
                                        $('#map-assoc').html(data);

                                }
                        });
